import { createSlice } from "@reduxjs/toolkit";

let cartSlice = createSlice({
    name:'cart',
    initialState:{
        cart:[]
    },
    reducers:{
        addtoCart: (state)
    }
})

export default cartSlice.reducer;
export let {} = cartSlice.actions;
